import React from 'react';
import Icon from "./components/Icon";
import { connect } from 'react-redux';

export default class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {

    return (
      <div className="wrapper">
        <h1>These are the icons</h1>
        <div id="container">
          <Icon name="flower" strokeWidth="3px"/>
          <Icon name="heart" strokeWidth="3px"/>
          <Icon name="star" strokeWidth="3px"/>
        </div>
      </div>
    )
  }

}
